import React from "react";
import {Container, Image, Menu} from "semantic-ui-react";
import {NavLink} from "react-router-dom";

import logo_tete_queue from "../images/logo_tete_queue.png";

class Header extends React.Component {
    render() {
        return (
            <Menu inverted fixed='top' size="massive">
                <Container>
                    <NavLink to="/">
                        <Menu.Item header >
                            <Image size='tiny' src={logo_tete_queue} style={{marginRight: '1.5em'}}/>
                            Acceuil
                        </Menu.Item>
                    </NavLink>
                    <NavLink to="IA"><Menu.Item >IA</Menu.Item></NavLink>
                    <NavLink to="UI"><Menu.Item >UI</Menu.Item></NavLink>
                    <NavLink to="Autre"><Menu.Item >Autre</Menu.Item></NavLink>
                </Container>
            </Menu>
        )
    }
}

export default Header;
